import React from "react";
import Item from "./Item"

const ItemList = ({datas, label}) => {
    return(
        <div>
            <h1 style={{textAlign: "center"}}>{label}</h1>
            <div>
            { datas.map((data, index) => 
            <Item data={data} key={data.id}/>) }

            </div>

        </div>

    )

}

export default ItemList;
